import React from "react";
import Nav from "./Nav";
import Row from "./Row";
import { useLocation } from "react-router-dom";


function App() {
    const location = useLocation();
    const data = location.state;

    return (
    <div>
        <div className="main-section">
            <Nav />
            <Row 
                h1 = "Nature Lovers' Club"
                sub1 = "Time: 9:00 AM to 5:00PM"
                src1 = "./pic1.png"
                h2 = "Innovators Quest"
                sub2 = "Time: 7:00 PM"
                src2 = "./pic2.png"
            />
            {/* <Row /> */}
        </div>
    </div>)
}

export default App;
